import React from "react";

class StatePro extends React.Component{

    constructor(props){
        super(props)

        this.state = {
            name : props.name
        }
    }

        render(){
            return(
                <React.Fragment>
                    <h1>{this.state.name}</h1>
                </React.Fragment>
            )
        }
}

export default StatePro;
